import React from "react";
import "./App.css";
import { useState } from "react";

export default function App() {
  const [grid, setGrid] = useState([5, 6]);

  return (
    <div className="App">
      <h1>MowGrass-IT</h1>
      <button type="button" class="btn btn-primary">
        Récupérer le sujet
      </button>

      <GetGridSizeArea />
    </div>
  );

  function handleChangeSize(event) {}

  function GetGridSizeArea() {
    return (
      <div>
        <p>Taille de la grille : </p>
        <div class="form-group row">
          <label for="example-number-input" class="col-2 col-form-label">
            Hauteur
          </label>
          <div class="col-1">
            <input
              class="form-control"
              type="number"
              value="0"
              id="example-number-input"
              onChange={handleChangeSize()}
            />
          </div>
        </div>
        <div class="form-group row">
          <label for="example-number-input" class="col-2 col-form-label">
            Largeur
          </label>
          <div class="col-1">
            <input
              class="form-control"
              type="number"
              value={grid[1]}
              id="example-number-input"
            />
          </div>
        </div>
      </div>
    );
  }
}
